import React, {Component} from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    useParams
  } from "react-router-dom";


function Product() {
    let { slug } = useParams();
  return (
    <>
       {slug}
    </>
  );
}



export default class Products extends Component {
    constructor(props) {
        super(props);
        this.state = {
          user: {},
          slug : <Product />
        };
      }

      componentDidMount = async () => {
          
        await api.UserProfile(payload).then(result => {
          this.setState({
            user: result.data
          });
    
    
        })
      }



  render() {
    return (
      <>
        {this.state.slug}
      </>
    )
  }
}
